import React from "react";
import {
  Box,
  Button,
  Typography,
  Select,
  MenuItem,
} from "@mui/material";
import Grid2 from '@mui/material/Unstable_Grid2';
import HomeIcon from "@mui/icons-material/Home";
import { useNavigate, useParams } from "react-router-dom";

interface RouteParams {
  [key: string]: string | undefined;
  championName?: string;
}

const ChampionDetails: React.FC = () => {
  const { championName } = useParams<RouteParams>();
  const navigate = useNavigate();
  return (
    <Box sx={{ p: 2 }}>
      {/* Ligne supérieure : Bouton Home à gauche et barre de recherche centrée */}
      <Grid2 container spacing={2} alignItems="center">
        {/* Bouton Home */}
        <Grid2  xs={3}>
          <Button variant="outlined" startIcon={<HomeIcon />} onClick={() => navigate("/")}>
            Home
          </Button>
        </Grid2>
        {/* Barre de recherche */}
        <Grid2  xs={6}>
          <input
            type="text"
            placeholder="Rechercher un champion..."
            style={{
              width: "100%",
              padding: "8px",
              borderRadius: "4px",
              border: "1px solid #ccc",
            }}
          />
        </Grid2>
        {/* Optionnel (espace réservé) */}
        <Grid2  xs={3}></Grid2>
      </Grid2>

      {/* Bandeau horizontal avec le titre (nom du champion), statistiques et sélecteur d'elo */}
      <Box
        sx={{
          my: 2,
          p: 1,
          backgroundColor: "#f0f0f0",
          borderRadius: "4px",
        }}
      >
        <Grid2 container alignItems="center" justifyContent="space-between">
          <Grid2 >
            <Typography variant="h5">{championName?.toLocaleUpperCase()}</Typography>
          </Grid2>
          <Grid2 >
            <Typography variant="body1">Winrate: 52%</Typography>
          </Grid2>
          <Grid2 >
            <Typography variant="body1">Pickrate: 12%</Typography>
          </Grid2>
          <Grid2 >
            <Typography variant="body1">Banrate: 6%</Typography>
          </Grid2>
          <Grid2 >
            <Select defaultValue="bronze" size="small">
              <MenuItem value="bronze">Bronze</MenuItem>
              <MenuItem value="silver">Silver</MenuItem>
              <MenuItem value="gold">Gold</MenuItem>
              <MenuItem value="challenger">Challenger</MenuItem>
            </Select>
          </Grid2>
        </Grid2>
      </Box>

      {/* Bandeau de boutons de navigation */}
      <Grid2 container spacing={1} sx={{ mb: 2 }}>
        {["Overview", "Items", "Masteries", "Sums", "Spells", "Stats"].map(
          (label) => (
            <Grid2  key={label}>
              <Button variant="text">{label}</Button>
            </Grid2>
          )
        )}
      </Grid2>

      {/* Zone principale : deux grandes colonnes */}
      <Grid2 container spacing={2}>
        {/* Colonne de gauche : Bouton Home + image du champion (déjà présent en haut, mais ici on le réaffiche dans le layout global) */}
        <Grid2  xs={3}>
          <Box sx={{ display: "flex", flexDirection: "column", gap: 2 }}>
            {/* Image verticale du champion */}
            <Box
              component="img"
              src="/Garen.jpg"
              alt="Champion"
              sx={{
                width: "80%",
                height: "80%",
                border: "1px solid #ccc",
                borderRadius: "4px",
              }}
            />
          </Box>
        </Grid2>

        {/* Colonne de droite : Détails et contenus divers */}
        <Grid2  xs={9}>
          <Grid2 container spacing={2}>
            {/* Première rangée : Zone des arbres de maîtrises */}
            <Grid2  xs={8}>
              {/* Arbre de maîtrises principales */}
              <Box
                sx={{
                  border: "1px solid #ccc",
                  p: 1,
                  minHeight: "300px",
                }}
              >
                <Typography variant="subtitle1">
                  Arbre de maîtrises principales
                </Typography>
                {/* Contenu à implémenter */}
              </Box>
            </Grid2>
            <Grid2  xs={4}>
              <Box sx={{ display: "flex", flexDirection: "column", gap: 2 }}>
                {/* Arbre de maîtrises secondaires */}
                <Box
                  sx={{
                    border: "1px solid #ccc",
                    p: 1,
                    minHeight: "140px",
                  }}
                >
                  <Typography variant="subtitle1">
                    Arbre de maîtrises secondaires
                  </Typography>
                  {/* Contenu à implémenter */}
                </Box>
                {/* Spell Order */}
                <Box
                  sx={{
                    border: "1px solid #ccc",
                    p: 1,
                    minHeight: "100px",
                  }}
                >
                  <Typography variant="subtitle1">Spell Order</Typography>
                  {/* Contenu à implémenter */}
                </Box>
              </Box>
            </Grid2>

            {/* Deuxième rangée : Items, Runes et Invocateurs */}
            <Grid2  xs={12}>
              <Grid2 container spacing={2}>
                {/* Runes */}
                <Grid2  xs={3}>
                  <Box sx={{ border: "1px solid #ccc", p: 1 }}>
                    <Typography variant="subtitle1">Runes</Typography>
                    {/* Contenu à implémenter */}
                  </Box>
                </Grid2>
                {/* Sorts d'invocateur */}
                <Grid2  xs={3}>
                  <Box sx={{ border: "1px solid #ccc", p: 1 }}>
                    <Typography variant="subtitle1">
                      Sorts d'invocateur
                    </Typography>
                    {/* Contenu à implémenter */}
                  </Box>
                </Grid2>
                {/* Zone Items : Start Items, Core Build et Late Game Items */}
                <Grid2  xs={6}>
                  <Box sx={{ display: "flex", flexDirection: "column", gap: 2 }}>
                    {/* Start Items */}
                    <Box sx={{ border: "1px solid #ccc", p: 1 }}>
                      <Typography variant="subtitle1">
                        Objets de départ
                      </Typography>
                      {/* Contenu à implémenter */}
                    </Box>
                    {/* Core Build */}
                    <Box sx={{ border: "1px solid #ccc", p: 1 }}>
                      <Typography variant="subtitle1">Core Build</Typography>
                      {/* Contenu à implémenter */}
                    </Box>
                    {/* Late Game Items */}
                    <Box sx={{ border: "1px solid #ccc", p: 1 }}>
                      <Typography variant="subtitle1">
                        Late Game Items
                      </Typography>
                      {/* Contenu à implémenter */}
                    </Box>
                  </Box>
                </Grid2>
              </Grid2>
            </Grid2>
          </Grid2>
        </Grid2>
      </Grid2>
    </Box>
  );
};

export default ChampionDetails;
